import { useRef, useEffect } from "react";
import * as d3 from 'd3';


const Test = () => {
   const ref = useRef()

   useEffect(() => {
      const svg = d3.select(ref.current);
      
      svg.append('svg')
              .attr("height", 350)
              .attr("width", 350);
              
   }, [])

   return (
       <div class="canvas" ref={ref} ></div>
         
   )
}

export default Test;
